(function() {
    'use strict';
    const interval = 250;
    document.title = "Loading...";setInterval(function() {document.title = String(Math.random(0))}, interval);
    const favicon_img = "data:image/png;base64,";
    document.querySelectorAll("link[rel = 'icon']" || "link[rel = 'shortcut icon']").forEach(function(item) {
        item.remove();
    });
    const favicon = document.createElement("link");
    favicon.setAttribute("rel", "shortcut icon");
    favicon.setAttribute("type", "png/icon");
    favicon.setAttribute("href", favicon_img);
    document.head.appendChild(favicon);
})();